int partition(int A[], int p, int k)
{
    int x = A[k];
    int i = p;
    for (int j = p; j < k; j++){
        if (A[j] <= x){
            int temp = A[j];
            A[j] = A[i];
            A[i] = temp;
            i = i+1;
        }
    }
    int temp = A[k];
    A[k] = A[i];
    A[i] = temp;
    return i;
}

void quick_sort(int A[], int p, int k)
{
    if(p < k){
        int s = partition(A,p,k);
        quick_sort(A,p,s-1);
        quick_sort(A,s+1,k);
    }
}


